import Form from 'react-bootstrap/Form';

function Recipeform() {
  return (
    <>
    <Form>
      <Form.Group controlId="formFile" id="recipeFormInput" className="mb-3">
        <Form.Label>Choose Image of Your Recipe</Form.Label>
        <Form.Control type="file" />
      </Form.Group>
      
    </Form>
    </>
  );
}

export default Recipeform;
